import Link from 'next/link';
import MyLogo from './MyLogo';

const linkStyle = {
  marginRight: 200,
};
const Header = () => (
  <div>
    <MyLogo/>
    <Link href="/">
      <a className="home">Home</a>
    </Link>
    <Link href="/about">
      <a className="about" >About</a>
    </Link> 
    <style jsx>{`
    *{
      display: flex;
    }
    a {
      color: white;
      text-decoration: none;
      padding: 10px 20px;
      background-color: blue;
      border: 1px solid white;
    }
    `}
    </style>
  </div>
);

export default Header;
